DROP TABLE IF EXISTS `merchant_cashier_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `merchant_cashier_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID,自增长',
  `merchant_id` int(11) NOT NULL COMMENT '商家ID',
  `table_code` varchar(45) NOT NULL COMMENT '餐桌编号',
  `cashier_amount` decimal(10,2) NOT NULL COMMENT '收银金额',
  `cashier_time` datetime NOT NULL COMMENT '收银时间',
  `cashier_method` int(11) NOT NULL COMMENT '收银方式（1=支付宝扫码支付, 2=微信扫码支付, 3=前台扫码支付, 4=现金支付, 5=支付宝转账, 6=微信转账,7=其它,8=会员余额消费）',
  `order_no` varchar(32) NOT NULL COMMENT '用餐订单号',
  `cashier_type` int(11) NOT NULL COMMENT '1=收款流水,2=退款流水',
  `cashier_source` int(11) NOT NULL COMMENT '日志记录来源(1=正常, 2=异常-属于手动查询支付宝或微信支付结果, 3=逃单了)',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `operation_staff` varchar(50) NOT NULL COMMENT '操作员（登录账号）',
  `create_time` datetime DEFAULT NULL COMMENT '记录创建时间',
  `modify_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=500 DEFAULT CHARSET=utf8 COMMENT='收银流水日志';
